ergente de creacin de observaciones. Se solicita que se verifique la funcionalidad de la lista desplegable dado que no permite consulta el responsable que se desea registrar. Desde el formulario modificar o firmar no deja crear tareas. , 1 WHERE id_acta=15 ")
